import './style.css';
import { t } from 'i18next';

function SearchButton() {
  return (
    <div className="search-button">
        <ul>
            <GoogleSearch />
            <LuckySearch />
        </ul>
    </div>
  )
}

const GoogleSearch = () => (
    <li>
        <button className="google-search" name="btnK" value="Google Search" type="submit">{t('google_search')}</button>
    </li>
);

const LuckySearch = () => (
    <li>
        <button className="lucky-search" name="https://www.google.com/search?gfns=1&sourceid=navclient&" value="I'm Feeling Lucky" type="submit">{t('lucky_search')}</button>
    </li>
);

export default SearchButton
